description:
Too Big For Teens 12 (NEW 2013 Reality Junkies) (Split Scenes)

CAST
Billy Glide, Casey Stone, Jordan Ash, Manuel Ferrara, Mia Malkova, Riley Reid, Staci Silverstone, Xander Corvus

Too Big For Teens 12: Riley is babysitting for Mr. Glide. While sitting poolside Mr. Glide comes out and lays down the rules for Riley, but rules aren`t going to stop her from getting what she wants. Mia`s looking for a ride to San Francisco, luckily for her Manuel is driving by. Mia has no money to pay Manuel for the lift, so she offers him something that he can`t refuse. Casey is really bad at golf and is in dire need of some lessons. Jordan comes along and helps her with her swing, but that`s not the only lesson he gives her. Staci`s out walking her dog, when it takes a giant crap on Xander`s lawn. Xander freaks out at her. So she turns on the charm while Xander teaches her a lesson about doggy style.

